import pflText from "../Assets/text.png";
import "./schedule.css";
export default function Create() {
  return (
    <div>
      <img
        src={pflText}
        alt="Logo"
        style={{
          display: "block",
          margin: "auto",
          width: "300px",
          marginTop: "20px",
        }}
      />
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h1
          style={{
            marginTop: "40px",
            backgroundColor: "#138ce8",
            width: "300px",
            textAlign: "center",
            height: "70px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          Group Matches
        </h1>
      </div>

      <div style={{ display: "flex", justifyContent: "center"}}>
        <div className="match"></div>
        <h1>V</h1>
        <div className="match"></div>
      </div>
    </div>
  );
}

